import React from 'react';

import PatientVitalsItem from './PatientItem/PatientVitalsItem';
import './UserList.css';

const patientVitalssList = props => {
  console.log("patient Vitalss list props", props.patientVitalss);
  const patientVitalss = props.patientVitalss.map(Vitals => {

    return (
      <PatientVitalsItem
        key={Vitals.name}
        userId={props.authUserId}
        name={Vitals.name}
        format={Vitals.format}
        path={Vitals.path}
      />
    );
  });

  return <ul className="user__list1">{patientVitalss}</ul>;
};

export default patientVitalssList;
